import { useContext, useState } from "react";
import { CartContext } from "./CartContext.jsx";
import { useOrder } from "./OrderContext.jsx";
import "./cart.css";

const Cart = () => {
  const { cart, updateQuantity, removeFromCart, clearCart } = useContext(CartContext);
  const { addOrder } = useOrder();

  // State for delivery address
  const [address, setAddress] = useState({
    village: "",
    streetNo: "",
    city: "",
    state: "",
    pincode: "",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setAddress((prevAddress) => ({
      ...prevAddress,
      [name]: value,
    }));
  };

  const handleSubmit = () => {
    if (!address.village || !address.city || !address.state || !address.pincode) {
      alert("Please fill in all address details.");
      return;
    }

    const newOrder = {
      items: [...cart],
      total: cart.reduce((total, item) => total + item.price * item.quantity, 0) + 50,
      address,
      orderDate: new Date().toLocaleString(),
    };

    addOrder(newOrder);
    alert("Order placed successfully!");
    clearCart();
    setAddress({ village: "", streetNo: "", city: "", state: "", pincode: "" });
  };

  return (
    <div className="container mt-5">
      <h2 className="text-center mb-4">Your Cart</h2>
      {cart.length === 0 ? (
        <div className="text-center">
          <p>Your cart is empty!</p>
        </div>
      ) : (
        <div className="row">
          {/* Cart Items */}
          <div className="col-md-8">
            {cart.map((item, index) => (
              <div key={index} className="cart-item d-flex justify-content-between">
                <div>
                  <h5>{item.name}</h5>
                  <p>Price: ₹{item.price}</p>
                  <div>
                    <button onClick={() => updateQuantity(item, item.quantity - 1)}>-</button>
                    <span>{item.quantity}</span>
                    <button onClick={() => updateQuantity(item, item.quantity + 1)}>+</button>
                  </div>
                </div>
                <p>₹{item.price * item.quantity}</p>
                <button onClick={() => removeFromCart(item)}>Remove</button>
              </div>
            ))}
          </div>

          {/* Summary and Address */}
          <div className="col-md-4">
            <div className="summary">
              <h4>Order Summary</h4>
              <p>Total: ₹{cart.reduce((total, item) => total + item.price * item.quantity, 0)}</p>
              <p>Shipping: ₹50</p>
              <p>
                Grand Total: ₹
                {cart.reduce((total, item) => total + item.price * item.quantity, 0) + 50}
              </p>
            </div>
            <div className="address">
              <h5>Delivery Address</h5>
              <input type="text" name="village" placeholder="Village" value={address.village} onChange={handleChange} />
              <input type="text" name="streetNo" placeholder="Street No" value={address.streetNo} onChange={handleChange} />
              <input type="text" name="city" placeholder="City" value={address.city} onChange={handleChange} />
              <input type="text" name="state" placeholder="State" value={address.state} onChange={handleChange} />
              <input type="text" name="pincode" placeholder="Pincode" value={address.pincode} onChange={handleChange} />
              <button onClick={handleSubmit}>Place Order</button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default Cart;
